import {useFocusRing} from 'react-aria'

import './App.css';

function Search(){
  let { isFocusVisible, focusProps } = useFocusRing();

  return (
    <div {...focusProps} style={{backgroundColor: isFocusVisible? "red" : "white"}}>
      <input className="searchbar--input" type="text"/>
    </div>
  )
}

function App() {
  return (
    <div className="content">
      <Search/>
    </div>
  );
}

export default App;
